import React from "react";
import { IoIosArrowForward } from "react-icons/io";
import "./RightArrowStyles.css";
import { Link } from "react-router-dom";

function RightArrow() {
  return (
    <div className="right-arrow-container">
      <Link to="/projects">
        <IoIosArrowForward />
      </Link>
    </div>
  );
}

export default RightArrow;
